GmCXt.decodeVersion = function(v) {

    if (!v) return 0;

    var num = [0, 0, 0];
    v = v.split('.');
    num[0] = v[0];
    num[1] = doubleDigit(v[1]);
    num[2] = doubleDigit(v[2]);
    if (v[3]) {
        num.push(doubleDigit(v[3]));
    } else {
        num.push("00");
    }

    return parseInt(num.join(''));

    function doubleDigit(num) {
        if (num && num <= 9 && num.length === 1) {
            num = "0" + num.slice(-2);
        }
        return num;
    }
};

