GmCXt.convertMgdata = function(m) {
	if (m.action && m.action.indexOf("init_sfdc_env") !== -1) {
		return m;
	} else if (GmCXt.isWestpac() && m.action && m.action.indexOf("MyGuideReporting") !== -1) {
		return m;
	}
	m.data = m.mgdata;
	return m;
};

