	var engLabels = GmCXt.getPlayerLabels('en_US');

	if (GmCXt.FT.creatorApp) {
		engLabels = GmCXt.mergeLabels(engLabels, GmCXt.getCreatorLabels('en_US'));
	}

	return engLabels;
