            for (var i = 0; i < $rootScope.botTourPlayList.length; i++) {
                if ($rootScope.botTourPlayList[i].tour_id === tour.tour_id) {
                    isBotTourExist = true;
                    break;
                }
            }
            return isBotTourExist;
