		if (!validatePowerForm()) return;

		if (!isPreview && step) {
			GmCXt.updateTooltipActionInfo(step.tour_id, step.step_id, step.step_settings.smarttip, "submit");
		}

		updatePowerFormHtml();
		var formHtml = mg$('.mgPlayerJSTest_form-injector-form').html();
